% This code takes as input the SVM results to create different tables and
% figures.

% Last modified: 17/03/2025 by Costanza Armanini

numSubjects = 2; %Number of subjects
numMovements = 49; % Number of movements
numReps = 6; % Number of repetitions
numSensors = 12; % Number of sensors
%%
%[text] ## Confusion Matrix
totalConfMat = zeros(numMovements, numMovements);

% Aggregate confusion matrices
for subject = 1:numSubjects
    filename = fullfile(sprintf('Results_S%d.mat', subject));
    data = load(filename, 'confMat');
    totalConfMat = totalConfMat + data.confMat;
end

% Calculate the average confusion matrix
averageConfMat = totalConfMat / numSubjects;

% Calculate overall accuracy
correctPredictions = sum(diag(averageConfMat)); % Sum of diagonal elements
totalSamples = sum(averageConfMat(:)); % Sum of all elements
averageAccuracy = (correctPredictions / totalSamples) * 100; % Percentage

% Calculate accuracy for each subclass of exercises

% For movements 1 to 17 (Exercise B)
exBConfMat = averageConfMat(1:17, 1:17);
exBCorrect = sum(diag(exBConfMat)); % Correct predictions for exB
exBTotal = sum(exBConfMat(:)); % Total samples for exB
exBAccuracy = (exBCorrect / exBTotal) * 100; % Percentage for exB

% For movements 18 to 39 (Exercise C)
exCConfMat = averageConfMat(18:39, 18:39);
exCCorrect = sum(diag(exCConfMat)); % Correct predictions for exC
exCTotal = sum(exCConfMat(:)); % Total samples for exC
exCAccuracy = (exCCorrect / exCTotal) * 100; % Percentage for exC

% For movements 40 to 49 (Exercise D)
exDConfMat = averageConfMat(40:49, 40:49);
exDCorrect = sum(diag(exDConfMat)); % Correct predictions for exD
exDTotal = sum(exDConfMat(:)); % Total samples for exD
exDAccuracy = (exDCorrect / exDTotal) * 100; % Percentage for exD

% Display accuracies
fprintf('Overall Accuracy: %.2f%%\n', averageAccuracy); %[output:521fbb97]
fprintf('Accuracy for movements 1-17 (ex B): %.2f%%\n', exBAccuracy); %[output:63ae302f]
fprintf('Accuracy for movements 18-39 (ex C): %.2f%%\n', exCAccuracy); %[output:4981167c]
fprintf('Accuracy for movements 40-49 (ex D): %.2f%%\n', exDAccuracy); %[output:6687c375]
%%
% Confusion matrix in terms of percentages

% Normalize to percentages
percentageConfMat = zeros(numMovements, numMovements); % Pre-allocate matrix
for i = 1:numMovements
    rowSum = sum(averageConfMat(i, :));
    if rowSum ~= 0
        percentageConfMat(i, :) = round((averageConfMat(i, :) / rowSum) * 100, 1); % Round to 1 decimal
    end
end

% Define gesture labels
gestureLabels = arrayfun(@(x) sprintf('%d', x), 1:numMovements, 'UniformOutput', false);

figure; %[output:4d499de1]
imagesc(percentageConfMat); %[output:4d499de1]
colormap(sky(100)); % Use a better colormap %[output:4d499de1]
clim([0, 100]); % Normalize color limits to percentage range %[output:4d499de1]
cb = colorbar; % Get the colorbar handle %[output:4d499de1]

% Customize colorbar 
cbTicks = cb.Ticks; % Get the colorbar ticks
cb.TickLabels = strcat(arrayfun(@(x) sprintf('%.1f%%', x), cbTicks, 'UniformOutput', false)); % Append % symbol %[output:4d499de1]


% Labels and title style
xlh =xlabel('Predicted Class', 'FontName', 'Palatino Linotype', 'FontSize', 14, 'FontWeight', 'bold', 'Color', [0.2 0.2 0.2]); %[output:4d499de1]
xlh.Position(2) = xlh.Position(2) - 0.3;  %[output:4d499de1]
ylh=ylabel('True Class', 'FontName', 'Palatino Linotype', 'FontSize', 14, 'FontWeight', 'bold', 'Color', [0.2 0.2 0.2]); %[output:4d499de1]
ylh.Position(1) = ylh.Position(1) - 0.3;  %[output:4d499de1]
title('Average Confusion Matrix (%)', 'FontName', 'Palatino Linotype', 'FontSize', 16, 'FontWeight', 'bold', 'Color', [0.1 0.1 0.1]); %[output:4d499de1]

% Set gestures labels
xticks(1:numMovements); %[output:4d499de1]
yticks(1:numMovements); %[output:4d499de1]
xticklabels(gestureLabels); %[output:4d499de1]
yticklabels(gestureLabels); %[output:4d499de1]
ax = gca;
ax.XTickLabelRotation = 45;  %[output:4d499de1]
set(gca,'TickLength',[0 0]) %[output:4d499de1]

% Add values inside each cell, replacing 0s with '-'
[numRows, numCols] = size(percentageConfMat);
for i = 1:numRows
    for j = 1:numCols
        value = percentageConfMat(i, j);
        
        if value == 0
            textColor = 'black'; % Always black for '-'
            text(j, i, '-', 'HorizontalAlignment', 'center', 'FontSize', 9, 'FontName', 'Palatino Linotype', 'Color', textColor);
        else
            textColor = 'black';
            if value > 50  % If the cell has a high percentage, use white text
                textColor = 'white';
            end
            text(j, i, sprintf('%.1f', value), 'HorizontalAlignment', 'center', 'FontSize', 9, 'FontName', 'Palatino Linotype', 'Color', textColor); %[output:4d499de1]
        end
    end
end


% Add cell borders
hold on; %[output:4d499de1]
for i = 1:numMovements+1
    plot([0.5, numMovements+0.5], [i-0.5, i-0.5], 'k', 'LineWidth', 0.5); % Horizontal lines %[output:4d499de1]
    plot([i-0.5, i-0.5], [0.5, numMovements+0.5], 'k', 'LineWidth', 0.5); % Vertical lines
end

% Add thicker colored lines to separate different exercise groups
groupBoundaries = [17, 40]; % Boundary positions for Exercise B, C, and D
boundaryColors = {'r', 'b', 'g'}; 

% Draw boundaries with different colors
for bIdx = 1:length(groupBoundaries)
    b = groupBoundaries(bIdx);
    plot([0.5, numMovements+0.5], [b+0.5, b+0.5], boundaryColors{bIdx}, 'LineWidth', 2.5); % Horizontal separator %[output:4d499de1]
    plot([b+0.5, b+0.5], [0.5, numMovements+0.5], boundaryColors{bIdx}, 'LineWidth', 2.5); % Vertical separator
end

% Add text labels for exercise groups on Y axis
text(-1, 9, 'Exercise B', 'FontSize', 12, 'FontWeight', 'bold', 'FontName', 'Palatino Linotype', 'Color', 'r', 'Rotation', 90); %[output:4d499de1]
text(-1, 28, 'Exercise C', 'FontSize', 12, 'FontWeight', 'bold', 'FontName', 'Palatino Linotype', 'Color', 'b', 'Rotation', 90); %[output:4d499de1]
text(-1, 45, 'Exercise D', 'FontSize', 12, 'FontWeight', 'bold', 'FontName', 'Palatino Linotype', 'Color', 'g', 'Rotation', 90); %[output:4d499de1]

% Add text labels for exercise groups on X axis
text(9, numMovements + 3.5, 'Exercise B', 'FontSize', 12, 'FontWeight', 'bold', 'FontName', 'Palatino Linotype', 'Color', 'r'); %[output:4d499de1]
text(28, numMovements + 3.5, 'Exercise C', 'FontSize', 12, 'FontWeight', 'bold', 'FontName', 'Palatino Linotype', 'Color', 'b'); %[output:4d499de1]
text(45, numMovements + 3.5, 'Exercise D', 'FontSize', 12, 'FontWeight', 'bold', 'FontName', 'Palatino Linotype', 'Color', 'g'); %[output:4d499de1]


hold off; %[output:4d499de1]
%%
%[text] ## Average Accuracy, Precision, Recall, F1 score and AUC for each movement
% Initialize variables to store aggregated results
total_precision = zeros(numMovements, numSubjects);
total_recall = zeros(numMovements, numSubjects);
total_F1 = zeros(numMovements, numSubjects);
auc_values = zeros(numMovements, numSubjects);
total_accuracy = zeros(numMovements, numSubjects); % Store movement-wise accuracy

for subject = 1:numSubjects
    filename = fullfile(sprintf('Results_S%d.mat', subject));
    data = load(filename);
    
    total_precision(:, subject) = data.precision;
    total_recall(:, subject) = data.recall;
    total_F1(:, subject) = data.F1;
    total_accuracy(:, subject) = data.movementAccuracy; % Load movement-wise accuracy

    % Calculate AUC for each movement
    for mov = 1:numMovements
        [X, Y, T, AUC] = perfcurve(data.y_test == mov, data.scores(:, mov), 1);
        auc_values(mov, subject) = AUC;
    end
end

% Compute mean values
mean_accuracy = mean(total_accuracy, 2);
mean_precision = mean(total_precision, 2);
mean_recall = mean(total_recall, 2);
mean_F1 = mean(total_F1, 2);
mean_auc = mean(auc_values, 2);
 

% Display table
class_labels = (1:numMovements)';
T = table(class_labels,  mean_accuracy, mean_precision, mean_recall, mean_F1, mean_auc, ...
    'VariableNames', {'Gesture', 'Accuracy', 'Precision', 'Recall', 'F1_Score', 'AUC'});
disp(T);
%[output:41f78102]
% Calculate the overall precision, recall, F1 score and AUC across all
% movements
overallPrecision = mean(mean_precision);
overallRecall = mean(mean_recall);
overallF1 = mean(mean_F1);
overallAUC = mean(mean_auc);

fprintf('Overall average precision across all gestures: %.2f%\n', overallPrecision); %[output:9ca943b7]
fprintf('Overall average recall across all gestures: %.2f%\n', overallRecall); %[output:22f381fe]
fprintf('Overall average F1 score across all gestures: %.2f%\n', overallF1); %[output:2bc2fc2a]
fprintf('Overall average AUC across all gestures: %.3f%\n', overallAUC); %[output:96159929]
%%
% Create a new figure for precision values
figure; %[output:25f08e10]

% Define a colormap
colors = lines(numMovements);

% Plot the median precision values for each movement
for i = 1:numMovements
    bar(i, mean_precision(i), 'FaceColor', colors(i, :), 'EdgeColor', colors(i, :)); %[output:25f08e10]
    hold on;
end

% Set common y-axis limits
ylim([0 100]); %[output:25f08e10]

% Set the x-axis labels
set(gca, 'XTick', 1:numMovements, 'XTickLabel', 1:numMovements); %[output:25f08e10]

title('Precision (%)', 'FontName', 'Palatino Linotype', 'FontSize', 16, 'FontWeight', 'bold', 'Color', [0.1 0.1 0.1]); %[output:25f08e10]
xlabel('Movement Label', 'FontName', 'Palatino Linotype', 'FontSize', 14, 'FontWeight', 'bold', 'Color', [0.2 0.2 0.2]); %[output:25f08e10]
ylabel('Precision', 'FontName', 'Palatino Linotype', 'FontSize', 14, 'FontWeight', 'bold', 'Color', [0.2 0.2 0.2]); %[output:25f08e10]
hold off; %[output:25f08e10]

% Adjust the figure size for better visibility
set(gcf, 'Position', [100, 100, 1000, 600]);  %[output:25f08e10]
saveas(gcf, 'Precision_All.svg'); %[output:25f08e10]
% Create a new figure for recall values
figure; %[output:4882a59b]

% Plot the median recall values for each movement
for i = 1:numMovements
    bar(i, mean_recall(i), 'FaceColor', colors(i, :), 'EdgeColor', colors(i, :)); %[output:4882a59b]
    hold on;
end

% Set common y-axis limits
ylim([0 100]); %[output:4882a59b]

% Set the x-axis labels
set(gca, 'XTick', 1:numMovements, 'XTickLabel', 1:numMovements); %[output:4882a59b]

title('Recall (%)', 'FontName', 'Palatino Linotype', 'FontSize', 16, 'FontWeight', 'bold', 'Color', [0.1 0.1 0.1]); %[output:4882a59b]
xlabel('Movement Label', 'FontName', 'Palatino Linotype', 'FontSize', 14, 'FontWeight', 'bold', 'Color', [0.2 0.2 0.2]); %[output:4882a59b]
ylabel('Recall', 'FontName', 'Palatino Linotype', 'FontSize', 14, 'FontWeight', 'bold', 'Color', [0.2 0.2 0.2]); %[output:4882a59b]
hold off; %[output:4882a59b]

% Adjust the figure size for better visibility
set(gcf, 'Position', [100, 100, 1000, 600]); % Adjust the figure size as needed %[output:4882a59b]
saveas(gcf, 'Recall_All.svg'); %[output:4882a59b]
% Create a new figure for F1 score values
figure; %[output:9676aad3]

% Plot the median F1 score values for each movement
for i = 1:numMovements
    bar(i, mean_F1(i), 'FaceColor', colors(i, :), 'EdgeColor', colors(i, :)); %[output:9676aad3]
    hold on;
end

% Set common y-axis limits
ylim([0 100]); %[output:9676aad3]

% Set the x-axis labels
set(gca, 'XTick', 1:numMovements, 'XTickLabel', 1:numMovements); %[output:9676aad3]

title('F1 Score (%)', 'FontName', 'Palatino Linotype', 'FontSize', 16, 'FontWeight', 'bold', 'Color', [0.1 0.1 0.1]); %[output:9676aad3]
xlabel('Movement Label', 'FontName', 'Palatino Linotype', 'FontSize', 14, 'FontWeight', 'bold', 'Color', [0.2 0.2 0.2]); %[output:9676aad3]
ylabel('F1 Score', 'FontName', 'Palatino Linotype', 'FontSize', 14, 'FontWeight', 'bold', 'Color', [0.2 0.2 0.2]); %[output:9676aad3]
hold off; %[output:9676aad3]

% Adjust the figure size 
set(gcf, 'Position', [100, 100, 1000, 600]);  %[output:9676aad3]
saveas(gcf, 'F1_All.svg'); %[output:9676aad3]
% Create a new figure for AUC values
figure; %[output:7cce23db]
for i = 1:numMovements
    bar(i, mean_auc(i), 'FaceColor', colors(i, :), 'EdgeColor', colors(i, :)); %[output:7cce23db]
    hold on;
end

ylim([0 1]); %[output:7cce23db]
title('AUC', 'FontName', 'Palatino Linotype', 'FontSize', 16, 'FontWeight', 'bold', 'Color', [0.1 0.1 0.1]); %[output:7cce23db]
xlabel('Movement Label', 'FontName', 'Palatino Linotype', 'FontSize', 14, 'FontWeight', 'bold', 'Color', [0.2 0.2 0.2]); %[output:7cce23db]
ylabel('AUC', 'FontName', 'Palatino Linotype', 'FontSize', 14, 'FontWeight', 'bold', 'Color', [0.2 0.2 0.2]); %[output:7cce23db]

set(gca, 'XTick', 1:numMovements, 'XTickLabel', 1:numMovements); %[output:7cce23db]
set(gcf, 'Position', [100, 100, 1000, 600]);  %[output:7cce23db]
saveas(gcf, 'AUC_All.svg'); %[output:7cce23db]

